        SDFCummutator_out_re_next <= xf_re;
        SDFCummutator_out_im_next <= xf_im;
        SDFCummutator_out_vld_next <= xf_vld;
      WHEN OTHERS => 
        SDFCummutator_mem_btf_switch_next <= to_unsigned(16#0#, 2);
