      WHEN "000" =>
        SDFCummutator_wrXData_re_reg_next <= to_signed(0, 32);
        SDFCummutator_wrXData_im_reg_next <= to_signed(0, 32);
        SDFCummutator_xWrAddr_next <= to_unsigned(16#0#, 3);
        SDFCummutator_xRdAddr_next <= to_unsigned(16#0#, 3);
