            IF btf_vld = '1' THEN 
              SDFCummutator_wrxEnb_reg_next <= '1';
              SDFCummutator_XState_next <= to_unsigned(16#2#, 3);
            ELSE 
              SDFCummutator_wrxEnb_reg_next <= '0';
              SDFCummutator_XState_next <= to_unsigned(16#1#, 3);
